import UserInput from "./UserInput";

const UserAdressWrapper = () => {
  return (
    <form className="address-container">
      <UserInput />
      <UserInput />
      <UserInput />
      <UserInput />
      <UserInput />
      <UserInput />
      <UserInput />
      <UserInput />
      <PhoneInput country={"ua"} />
    </form>
  );
};

export default UserAdressWrapper;
